import React,{Component} from 'react';
import './App.css';
import Clarifai from'clarifai';

//import Scroll from './Scroll';
import Navigation from './component/Navigation/Navigation';
import Logo from './component/Logo/Logo';
import ImageLinkForm from './component/ImageLinkForm/ImageLinkForm';
import FaceRecognization from './component/FaceRecognization/FaceRecognization';

import Rank from './component/Rank/Rank';

const app = new Clarifai.App({
 apiKey: 'ef8334c968c5424f9544d25f1ac54028'
});



class App extends Component{
  constructor(){
        super()
        this.state={
          input: ''
        }
  }
  onInputChange=(event)=>{
    console.log(event.target.value)
  }
  onButtonClick=()=>{

   app.models
      .predict(
        "ef8334c968c5424f9544d25f1ac54028",
        "https://in.images.search.yahoo.com/images/view;_ylt=AwrwJUisULleq2QAt669HAx.;_ylu=X3oDMTIyYzQxZmJnBHNlYwNzcgRzbGsDaW1nBG9pZAMxNTMwNzJhMjNiMTc1N2Q1MWQ3MjlhMzcwYzM2ZjEwYgRncG9zAzYEaXQDYmluZw--?back=https%3A%2F%2Fin.images.search.yahoo.com%2Fsearch%2Fimages%3Fp%3Dlandscape%26fr%3Dmcafee%26fr2%3Dpiv-web%26tab%3Dorganic%26ri%3D6&w=1280&h=720&imgurl=i.ytimg.com%2Fvi%2FD6K2vZY5Jlw%2Fmaxresdefault.jpg&rurl=https%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3DD6K2vZY5Jlw&size=137.8KB&name=Landscape+Photography+in+Yellowstone+National+Park+-+YouTube&p=landscape&oid=153072a23b1757d51d729a370c36f10b&fr2=piv-web&fr=mcafee&tt=Landscape+Photography+in+Yellowstone+National+Park+-+YouTube&b=0&ni=21&no=6&ts=&tab=organic&sigr=ClGXy6HenHN2&sigb=6bRXuJzUf4fr&sigi=hEq_bZgV54_j&sigt=TEj0lHS48NVO&sign=TEj0lHS48NVO&.crumb=F8feSadIr28&fr=mcafee&fr2=piv-web"
        )
      .then(response => {
          console.log(response)
          })



    console.log('click')
  }     

	render(){
    return(
      <div>
         <Navigation/>
         <Logo/>
         <Rank/>
         <ImageLinkForm onInputChange={this.onInputChange} onButtonClick={this.onButtonClick}  />
         <FaceRecognization/>
      </div>

      );
  }
}
export default App;
